:host { --tooltip-top: var(--tool-tip-position-top, 0); --tooltip-left: var(--tool-tip-position-left, 0); font: var(--text-body-shorthand-small); text-align: center; text-decoration: none; text-shadow: none; text-transform: none; letter-spacing: normal; border-radius: var(--borderRadius-medium); opacity: 0; max-width: var(--overlay-width-small); overflow-wrap: break-word; white-space: normal; text-wrap-style: balance; padding: var(--overlay-paddingBlock-condensed) var(--overlay-padding-condensed) !important; color: var(--tooltip-fgColor, var(--fgColor-onEmphasis)) !important; background: var(--tooltip-bgColor, var(--bgColor-emphasis)) !important; border: 0px !important; width: max-content !important; inset: var(--tooltip-top) auto auto var(--tooltip-left) !important; overflow: visible !important; }:host(:is(.tooltip-n, .tooltip-nw, .tooltip-ne)) { --tooltip-top: calc(var(--tool-tip-position-top, 0) - var(--overlay-offset, 0.25rem)); --tooltip-left: var(--tool-tip-position-left); }:host(:is(.tooltip-s, .tooltip-sw, .tooltip-se)) { --tooltip-top: calc(var(--tool-tip-position-top, 0) + var(--overlay-offset, 0.25rem)); --tooltip-left: var(--tool-tip-position-left); }:host(.tooltip-w) { --tooltip-top: var(--tool-tip-position-top); --tooltip-left: calc(var(--tool-tip-position-left, 0) - var(--overlay-offset, 0.25rem)); }:host(.tooltip-e) { --tooltip-top: var(--tool-tip-position-top); --tooltip-left: calc(var(--tool-tip-position-left, 0) + var(--overlay-offset, 0.25rem)); }:host::after { position: absolute; display: block; right: 0px; left: 0px; height: var(--overlay-offset, 0.25rem); content: ""; }:host(.tooltip-s)::after, :host(.tooltip-se)::after, :host(.tooltip-sw)::after { bottom: 100%; }:host(.tooltip-n)::after, :host(.tooltip-ne)::after, :host(.tooltip-nw)::after { top: 100%; }@keyframes tooltip-appear { 
  0% { opacity: 0; }
  100% { opacity: 1; }
}:host(:popover-open), :host(:popover-open)::before { animation-name: tooltip-appear; animation-duration: 0.1s; animation-fill-mode: forwards; animation-timing-function: ease-in; }:host(.\:popover-open) { animation-name: tooltip-appear; animation-duration: 0.1s; animation-fill-mode: forwards; animation-timing-function: ease-in; }@media (forced-colors: active) {
  :host { outline: transparent solid 1px; }
  :host::before { display: none; }
}

